import React from 'react';
import PropTypes from 'prop-types';


const WeatherCard = ({ weatherData }) => {
  console.log(weatherData);

  return (
    <div className='weather-div column s-evenly'>
      <h1>
        {
          weatherData.location.name
        }
      </h1>
      <p className='gray'>
        {
          `${weatherData.location.region}, ${weatherData.location.country}`
        }        
      </p>
      <h1>{ weatherData.current.condition.text }</h1>
      <img src={ weatherData.current.condition.icon } alt='condition img' />
      <div class="cardContainer">
<div class="card">
  <p class="city">PINK CITY</p>
  <p class="weather">PARTILY CLOUDY</p>
    <p class="temp">32°</p>
    <div class="minmaxContainer">
      <div class="min">
        <p class="minHeading">Min</p>
        <p class="minTemp">30°</p>
      </div>
      <div class="max"><p class="maxHeading">Max</p>
        <p class="maxTemp">32°</p></div>
    </div>

</div>
</div>
    </div>
)};

WeatherCard.propTypes = {};

WeatherCard.defaultProps = {};

export default WeatherCard;
